import React from 'react';
import '../css/main.css';

class DayRowTable extends React.Component {
    render() {
        return (
            <tr className="table__row--body" data-id={this.props.id}>
                <td className="table__cell table__cell--body">{this.props.start} - {this.props.finish}</td>
                <td className="table__cell table__cell--body">{this.props.visits}</td>
            </tr>
        );
    }
}

export default DayRowTable;
